mobi Music - это музыкальное приложение для абонентов activ и Kcell. Открывайте мир музыки вместе с нами:

• Миллионы песен казахстанских и зарубежных исполнителей;
• Оффлайн режим: возможность скачивать и слушать музыку без интернета;
• Бесплатное онлайн-радио без авторизации;
• Бесплатный интернет-трафик;
• Высокое качество звука – mp3, 320 кбит/с;

- Оффлайн режим
Скачивайте песни в память смартфона и слушайте их без интернета! Пока у вас есть интернет, нажмите рядом с любимыми треками кнопку “стрелка вниз”. Трек сохранится в память устройства. И когда интернета не будет, вы по-прежнему сможете слушать музыку.

- Музыка всех стилей и направлений
Жанры для любого меломана: рок, поп, рэп, шансон, хип-хоп, джаз, электронная музыка, российские или казахские песни, саундтреки, легкая и даже классическая музыка. В mobi Music найдется музыка для каждого!

- Персональные рекомендации
Узнавайте о новых альбомах, находите интересных исполнителей, смотрите, какую музыку слушают другие пользователи - всё это доступно в разделе «Рекомендации».

- Музыкальные подборки 
Слушайте песни на все случаи жизни в специальных подборках от нашего редактора: хит-парад, для разных занятий, под настроение, для тренировок и множество других!

- Быстрый и удобный поиск музыки
Удобный поиск, который позволяет легко искать песни, альбомы, исполнителей и плейлисты. Мы помогаем найти идеальную музыку для любого момента и настроения!

- Универсальный доступ: музыка там, где вы!
Вместе с mobi Music у вас появится возможность слушать музыку везде: дома и на работе с компьютера, в машине, в общественном транспорте с телефона. Не важно, одни вы или в компании – просто нажмите play!

Оформите подписку и получите возможность:
• Слушать музыку без ограничений и назойливой рекламы;
• Составлять собственные плейлисты прямо из плеера;
• Скачивать песни в память устройства для прослушивания оффлайн;
• Слушать радио бесплатно и без авторизации;
• Читать тексты любимых песен в плеере;
• Делиться музыкой в социальных сетях.

Скачивайте, делитесь с друзьями и наслаждайтесь любимыми песнями вместе с mobi Music! Если что-то пошло не так, напишите нам в раздел "Обратная связь" – мы обязательно придем на помощь!

